export class App extends Component {
  state = {
    toCoordinates:{}
  };

  setCoordinates=(coordinates)=>{
    this.setState({
      toCoordinates: coordinates
  }, ()=>{
    console.log(this.state.toCoordinates)
  })


  }
  render(){
  return (
    <div>
      <Grid container
  direction="row"
  justify="flex-start"
  alignItems="center">
        <Grid item xs>
          <NameSearch setCoordinates={this.setCoordinates}/>
          <NameSearch/>
        </Grid>
        <Grid item xs>
          <MapContainer/>
        </Grid>
      </Grid>


    </div>
  );

  }
}

export default App;
